import React, { Component } from 'react';
import axios from 'axios';

class AdminLogin extends Component {

    state = {
        login: true,
        username: "",
        password: "",
    }

    handleChangeUsername(e) {
        this.setState({ username: e.target.value })
    }

    handleChangePassword(e) {
        this.setState({ password: e.target.value })
    }

    handleRegisterState(e) {
        e.preventDefault()
        this.setState({ login: false })
    }

    handleLoginState(e) {
        e.preventDefault()
        this.setState({ login: true })
    }

    handleSubmitButton(e) {

    }

    handleSubmitLogin(e) {
        e.preventDefault()
    }


    handleSubmitRegister(e) {
        e.preventDefault()
    }

    render() {
        return (
            <div>
                {this.state.login && <form onSubmit={this.handleSubmitLogin.bind(this)}>
                    <div>
                        Användarnamn:
                </div>
                    <div>
                        <input id={"username"} type={"text"} placeholder={"username"} onChange={this.handleChangeUsername.bind(this)}></input>
                    </div>
                    <div>
                        Lösenord:
                </div>
                    <div>
                        <input id={"password"} type={"text"} placeholder={"password"} onChange={this.handleChangePassword.bind(this)}></input>
                    </div>
                    <div>
                        <button id={"login"} type={"submit"} onClick={this.handleSubmitButton.bind(this)}>Logga in</button>
                        <button id={"changeregister"} type={"submit"} name="changeregister" onClick={this.handleRegisterState.bind(this)}>Registera</button>
                    </div>
                </form>} {!this.state.login && <form onSubmit={this.handleSubmitRegister.bind(this)}>
                    <div>
                        Användarnamn:
                </div>
                    <div>
                        <input id={"username"} type={"text"} placeholder={"username"} onChange={this.handleChangeUsername.bind(this)}></input>
                    </div>
                    <div>
                        Lösenord:
                </div>
                    <div>
                        <input id={"password"} type={"text"} placeholder={"password"} onChange={this.handleChangePassword.bind(this)}></input>
                    </div>
                    <div>
                        <button id={"register"} type={"submit"} onClick={this.handleRegisterButton.bind(this)}>Registera</button>
                        <button id={"login"} type={"submit"} onClick={this.handleLoginState.bind(this)}>Logga in istället</button>
                    </div>
                </form>}

            </div>
        )
    }
}

export default AdminLogin;
